import Post from './Post'

const Posts=(props)=>(
    <>
        <p>Hola desde Posts</p>
        {
            props.articles.map(a=>(
                <Post 
                    key={a._id}
                    title={a.headlines.basic}
                    image={a.promo_items.basic.url}
                    altImg={a.promo_items.basic.subtitle}
                    
                />
            ))
        }
    </>
)

export default Posts
